def atoi(s):
    pos=0
    isNegative=False
    if (s[0] == '-'):
        isNegative=True
        pos=1
    elif (s[0] == '+'):
        pos=1
    result=0
    for x in s[pos:]:
        if (x >= '0' and x <= '9'):
            result = 10 * result + (ord(x) - ord('0'))
        else:
            break
    return result * (-1 if isNegative else 1)


